import React from "react";
import { ThemeProvider, centered } from "../styles/theme";
import { Hero, Container, Row, Column, Subheader } from "../styles/common";
import { hero, testimonials } from "../content/testimonials-page.json";

const Testimonials = props => {
  return (
    <ThemeProvider>
      <Hero layout={centered}>
        <Container>
          <Row>
            <Column>
              <Header>{hero.header}</Header>
              <Subheader>{hero.subheader}</Subheader>
            </Column>
          </Row>
        </Container>
      </Hero>
    </ThemeProvider>
  );
};
export default Testimonials;
